import {createSlice, PayloadAction} from "@reduxjs/toolkit";

export type ChocoType='white' | 'milk' |'dark'| 'without'
export type SizeType='small' | 'medium' | 'large'

export type CoffeeType = {
    id: number
    name: string
    type: string
    price: number
    description: string
    favorite:boolean
    rating: number
    img: string,
    choco:ChocoType | undefined,
    milk:boolean,
    size:SizeType | undefined
}

export type InitialStateType=typeof initialState
export type CapsType={
    id:number
    cap:CoffeeType
    count: number,
    isChecked:boolean
}

