const slice = createSlice({
    name: 'coffee',
    initialState,
    reducers: {
        addCoffee(state, action:PayloadAction<{cap:CoffeeType,count?:number}>){
          if(state.data.findIndex(d=>d.cap.id===action.payload.cap.id) ===-1){
              state.data.unshift({cap:action.payload.cap, count: action.payload.count
                      ?action.payload.count:
                      1,isChecked:false,id:+(new Date())})
          }else {
              state.data.forEach(d=>d.cap.id===action.payload.cap.id
                  ?{...d,count: action.payload.count
                          ?d.count=d.count+action.payload.count
                          :d.count++}
                  :d)
          }
        },
        deleteCoffee(state, action:PayloadAction<{id:number}>){
            let cap=state.data.find(d=>d.cap.id===action.payload.id)
            if(cap && cap.count===1) {
               state.data=state.data.filter(d=>d.cap.id!==action.payload.id)

            }else{
                state.data.map(d=>d.cap.id===action.payload.id?{...d,count:d.count--}:d)
            }
        },
        deleteAll(state){
            state.data=[]
        },
        setNewParam(state,action:PayloadAction<{id:number,favorite?:boolean,choco?:ChocoType,size?:SizeType}>){
            if(action.payload.favorite){
                state.startData=state.startData.map(d=>d.id===action.payload.id
                    ?{...d,favorite:!d.favorite}
                    :d)
            }
            if(action.payload.choco){
                state.startData=state.startData.map(d=>d.id===action.payload.id
                    ?{...d,choco:action.payload.choco}
                    :d)
            }
            if(action.payload.size){
                state.startData=state.startData.map(d=>d.id===action.payload.id
                    ?{...d,size:action.payload.size}
                    :d)
            }
        },
        setIsCheckedData(state,action:PayloadAction<{id:number}>){
            state.data=state.data.map(d=>d.cap.id===action.payload.id?{...d,isChecked:!d.isChecked}:d)
        },
        setIsCheckedAllData(state,action:PayloadAction<{isAll:boolean}>){
           state.data= state.data.map(d=>({...d,isChecked:action.payload.isAll}))
        }
    }
    })

export const coffeeReducer = slice.reducer
export const {addCoffee,deleteCoffee,deleteAll,setNewParam,setIsCheckedData,setIsCheckedAllData}=slice.actions
